import React from 'react'
import "./LogAlert.css"

const LogAlert = () => {
  return (
    <div className='logAlert_body'>
        <div className=''>
            It seems like a user with email id: User is already Logged in. 
            Log-out before Signing In. 
        </div>
    </div>
  )
}

export default LogAlert
